begin
wwv_flow_imp_shared.create_plugin(
 p_id=>wwv_flow_imp.id(331768306811252082)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'JD.INPUT_ITEM_MASK'
,p_display_name=>'Input Item - Mask (18.2)'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('ITEM TYPE','JD.INPUT_ITEM_MASK'),'')
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'PROCEDURE render_item (',
'     p_item   in apex_plugin.t_item,',
'     p_plugin in apex_plugin.t_plugin,',
'     p_param  in apex_plugin.t_item_render_param,',
'     p_result in out nocopy apex_plugin.t_item_render_result)',
'IS',
'    -- Get Plugin Item Attributes',
'    l_result      apex_plugin.t_page_item_render_result;',
'    l_input_type  varchar2(10)   := p_item.attribute_02;',
'    l_input_value varchar2(255)  := p_item.attribute_03;',
'    l_direction   varchar2(255)  := p_item.attribute_04;',
'    l_options     varchar2(1000) := p_item.attribute_05;',
'    l_name        varchar2(30)   := apex_plugin.get_input_name_for_page_item(false);',
'    --',
'BEGIN',
'  -- support fo RO an Print functionality',
'	IF p_param.is_printer_friendly OR p_param.is_readonly THEN',
'    --  ',
'		apex_plugin_util.print_hidden_if_readonly (',
'		    p_item_name           => p_item.name,',
'		    p_value               => p_param.value,',
'		    p_is_readonly         => p_param.is_readonly,',
'		    p_is_printer_friendly => p_param.is_printer_friendly);',
'		--',
'		apex_plugin_util.print_display_only (',
'		    p_item_name        => p_item.name,',
'		    p_display_value    => p_param.value,',
'		    p_show_line_breaks => false,',
'		    p_escape           => true,',
'		    p_attributes       => p_item.element_attributes );',
'    --	',
'	ELSE',
'	 	-- Output the HTML to render the Text Field.',
'    htp.p(	''<input type="text" autocomplete="off" name="''||l_name||',
'    		''" id="''     ||p_item.name||''" ''||',
'    		''value="''    ||htf.escape_sc(p_param.value)||',
'    		''" size="''   ||p_item.element_width||''" ''||',
'    		''maxlength="''||p_item.element_max_length||''" ''||',
'        ''class="''    ||p_item.element_css_classes||'' apex-item-text text_field" ''||',
'        ''style="direction:''||l_direction||''" ''||',
'    		p_item.element_attributes||'' />'');',
'  -- Add inputmask property initalization and property for the Item',
'  apex_javascript.add_onload_code (',
'            p_code => ''apex.jQuery("#''||p_item.name||''").inputmask({''',
'                   || ''"''|| l_input_type ||''" : "''  || l_input_value ||''"''',
'                   || '', "placeholder" : "''         || p_item.placeholder ||''"''',
'                   || '', ''                          || l_options',
'                   || ''});''',
'   );',
'   -- Load necessary JS lib''s',
'	apex_javascript.add_library (',
'	  p_name      => ''jquery.inputmask.bundle.min'',  -- The name of the JS file',
'	  p_directory => p_plugin.file_prefix,	     -- The directory of the js file',
'	  p_version   => null );',
'  --',
'  apex_javascript.add_library (',
'	  p_name      => ''inputmask.extensions.min'',  -- The name of the JS file',
'	  p_directory => p_plugin.file_prefix,	      -- The directory of the js file',
'	  p_version   => null );',
'  --',
'  apex_javascript.add_library (',
'	  p_name      => ''inputmask.phone.extensions.min'',  -- The name of the JS file',
'	  p_directory => p_plugin.file_prefix,	      -- The directory of the js file',
'	  p_version   => null );',
'  --',
'  apex_javascript.add_library (',
'	  p_name      => ''inputmask.date.extensions.min'',  -- The name of the JS file',
'	  p_directory => p_plugin.file_prefix,	      -- The directory of the js file',
'	  p_version   => null );',
'  --',
'  apex_javascript.add_library (',
'	  p_name      => ''inputmask.numeric.extensions.min'',  -- The name of the JS file',
'	  p_directory => p_plugin.file_prefix,	      -- The directory of the js file',
'	  p_version   => null );',
'	END IF;',
'  --',
'END render_item ;'))
,p_api_version=>2
,p_render_function=>'render_item'
,p_standard_attributes=>'VISIBLE:SESSION_STATE:READONLY:QUICKPICK:SOURCE:ELEMENT:WIDTH:HEIGHT:ELEMENT_OPTION:PLACEHOLDER:ENCRYPT'
,p_substitute_attributes=>true
,p_version_scn=>1
,p_subscribe_plugin_settings=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'Input type plugin based on the inputmask.js',
' library (http://robinherbots.github.io/Inputmask) under MIT license'))
,p_version_identifier=>'1.0'
,p_about_url=>'https://www.linkedin.com/in/jozef-demovic-692295109/'
,p_files_version=>36
);
