 p_id=>wwv_flow_imp.id(189854579216476585)
,p_plug_name=>'R_HOME'
,p_region_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_imp.id(196040343629629265)
,p_plug_display_sequence=>20
,p_function_body_language=>'PLSQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
' V_BODY CLOB;',
'--',
' CURSOR CUR_DADOS IS',
' SELECT REGEXP_SUBSTR(U.NOME,''[^ ]+'', 1, 1) NOME',
'    ,   TO_CHAR(SYSDATE-3/24, ''DD/MM/YYYY'') DATA_SISTEMA',
'    ,   TO_CHAR(SYSDATE-3/24, ''HH24:MI'') HORA_SISTEMA',
'    ,   TO_CHAR(SYSDATE-3/24, ''DAY'') DATA_SEMANA',
'    ,   0 MENSAGEM',
'   FROM USUARIO U',
'  WHERE U.ID = PCK_AUTENTICACAO.F_USUARIO;',
'--',
'BEGIN',
'  --',
'   FOR X IN CUR_DADOS LOOP',
'    --',
unistr('     V_BODY := ''<h3> Ol\00E1, '' || X.NOME || ''.</h3>'';'),
unistr('     V_BODY := V_BODY || ''<h3> Hoje \00E9 '' || X.DATA_SISTEMA || '', '' || INITCAP(X.DATA_SEMANA)  || '' e a hora do sistema \00E9 '' || X.HORA_SISTEMA ||''. </h3>'';'),
'     V_BODY := V_BODY || ''<h3> Escolha a funcionalidade pelo menu lateral. </h3>'';',
'    --',
'   END LOOP;',
'  --',
'   RETURN V_BODY;',
'  --',
'END;'))
,p_lazy_loading=>false
,p_plug_source_type=>'NATIVE_DYNAMIC_CONTENT'
);
end;
