'',
'BEGIN',
'',
unistr('    --:P5_TIPO_SERVICO 1-EM OPERA\00C7\00C3O'),
'    IF :P5_TIPO_SERVICO = ''O'' THEN',
'        IF :P5_NACIONALIDADE = ''N'' THEN',
'            V_URL := APEX_PAGE.GET_URL(',
'                P_APPLICATION => :APP_ID,',
'                P_PAGE        => 2,',
'                P_ITEMS       => ''P2_ID,P2_NACIONALIDADE'',',
'                P_VALUES      => :P5_ID || '','' || ''N'',',
'                P_CLEAR_CACHE => 2',
'            );',
'         ELSE',
