'                P_APPLICATION => :APP_ID,',
'                P_PAGE        => 4,',
'                P_ITEMS       => ''P4_ID,P4_NACIONALIDADE'',',
'                P_VALUES      => :P5_ID || '','' || ''E'',',
'                P_CLEAR_CACHE => 4',
'            );',
'        END IF;',
unistr('    ELSIF :P5_TIPO_SERVICO = ''C'' THEN --EM CONSTRU\00C7\00C3O'),
'        V_URL := APEX_PAGE.GET_URL(',
'            P_APPLICATION => :APP_ID,',
'            P_PAGE        => 24,',
'            P_ITEMS       => ''P24_ID,P4_NACIONALIDADE'',',
'            P_VALUES      => :P5_ID || '','' || ''E'',',
'            P_CLEAR_CACHE => 24',
'        );',
unistr('    ELSIF :P5_TIPO_SERVICO = ''R'' THEN --EMBARCA\00C7\00C3O EM REFORMA'),
'        V_URL := APEX_PAGE.GET_URL(',
'            P_APPLICATION => :APP_ID,',
'            P_PAGE        => 25,',
'            P_ITEMS       => ''P25_ID,P4_NACIONALIDADE'',',
'            P_VALUES      => :P5_ID || '','' || ''E'',',
'            P_CLEAR_CACHE => 25',
'        );',
'    END IF;',
'',
'    APEX_UTIL.REDIRECT_URL (V_URL);',
'',
' END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
