'    V_CNPJ_CPF_VALIDO   VARCHAR2(1);',
'    V_URL               VARCHAR2(1000);',
'',
'BEGIN',
unistr('    -- Fun\00E7\00E3o para validar CPF/CNPJ (tempor\00E1rio at\00E9 que a API da RFB esteja dispon\00EDvel)'),
'    V_VALIDO := PCK_UTIL.F_VALIDA_CPF_CNPJ(:P5_PROPRIEDADE);',
'',
unistr('    -- Verifica se o CPF/CNPJ \00E9 v\00E1lido e se o campo propriedade n\00E3o est\00E1 nulo'),
'    IF V_VALIDO = ''1'' AND :P5_PROPRIEDADE IS NOT NULL THEN',
unistr('        -- CPF/CNPJ v\00E1lidos: define mensagem de sucesso e valores correspondentes'),
unistr('        APEX_APPLICATION.G_PRINT_SUCCESS_MESSAGE := ''CPF/CNPJ V\00C1LIDO.'';'),
'        V_CNPJ_CPF_VALIDO   := ''Y'';',
unistr('        V_TEXTO             := ''RAZ\00C3O SOCIAL'';'),
'    ELSE',
unistr('        -- CPF/CNPJ inv\00E1lidos: define valores padr\00E3o'),
unistr('        APEX_APPLICATION.G_PRINT_SUCCESS_MESSAGE := ''CPF/CNPJ inv\00E1lido.'';'),
'        V_CNPJ_CPF_VALIDO   := ''N'';',
'        V_TEXTO             := '''';',
'    END IF;',
'',
unistr('    -- Define os valores dos itens de retorno com base nos resultados da valida\00E7\00E3o'),
'    :P5_CNPJ_CPF_VALIDO             := V_CNPJ_CPF_VALIDO;',
'',
'    -- Atualiza a tabela TEMP_EMBARCACAO com os dados formatados',
'    UPDATE TEMP_EMBARCACAO T',
'       SET T.DOCUMENTO_PROPRIEDADE      = REGEXP_REPLACE(:P5_PROPRIEDADE, ''[^0-9]'', ''''),',
'           T.NUM_INSCRICAO              = REGEXP_REPLACE(:P5_NUM_INSCRICAO, ''[^A-Za-z0-9]'', ''''),',
'           T.FINALIDADE_EMBARCACAO      = :P5_FINALIDADE_EMBARCACAO,',
'           T.RAZAO_SOCIAL_PROPRIETARIO  = V_TEXTO,',
'           T.NACIONALIDADE              = :P5_NACIONALIDADE',
'     WHERE T.COD_EMBARCACAO = :P5_ID;',
'',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(5722298071239517)
