,p_process_sequence=>10
,p_process_point=>'BEFORE_HEADER'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'PRC_CARREGA_DADOS'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
unistr('-- Se o ID da embarca\00E7\00E3o n\00E3o estiver definido, inicializa a nacionalidade e insere um novo registro'),
'IF :P5_ID IS NULL THEN',
'    ',
'    :P5_NACIONALIDADE := '''';',
'',
'    -- Insere um novo registro na tabela TEMP_EMBARCACAO e retorna o ID gerado',
'    INSERT INTO TEMP_EMBARCACAO (COD_EMBARCACAO, USUARIO, PAGINA_ETAPA)',
'         VALUES (TEMP_EMBARCACAO_SEQ.NEXTVAL,',
unistr('                 :APP_USER,            -- Usu\00E1rio atual'),
unistr('                 :APP_PAGE_ID)         -- P\00E1gina da etapa atual'),
'      RETURNING COD_EMBARCACAO',
unistr('           INTO :P5_ID;                -- Armazena o ID gerado no item de p\00E1gina P5_ID'),
'',
'ELSE',
unistr('    -- Se o ID j\00E1 existir, seleciona os dados da embarca\00E7\00E3o correspondente e os carrega nos itens da p\00E1gina'),
'    SELECT ',
'          T.NACIONALIDADE,',
'          NUM_CASCO,',
'          NUM_INSCRICAO,',
'          FINALIDADE_EMBARCACAO,',
'          DOCUMENTO_PROPRIEDADE,',
'          CNPJ_ESTALEIRO,',
'          RAZAO_SOCIAL_PROPRIETARIO,',
'          NVL(TIPO_SERVICO, ''O'')    -- Se TIPO_SERVICO for nulo, define ''O''',
'    INTO ',
'          :P5_NACIONALIDADE,',
'          :P5_NUM_CASCO,',
'          :P5_NUM_INSCRICAO,',
'          :P5_FINALIDADE_EMBARCACAO,',
'          :P5_PROPRIEDADE,',
'          :P5_CNPJ_ESTALEIRO,',
'          :P5_RAZAO_SOCIAL_PROPRIETARIO,',
'          :P5_TIPO_SERVICO',
'     FROM TEMP_EMBARCACAO T',
unistr('    WHERE T.COD_EMBARCACAO = :P5_ID;   -- Busca pela embarca\00E7\00E3o com o ID especificado'),
'END IF;',
''))
,p_process_clob_language=>'PLSQL'
