'DECLARE',
'--',
' V_URL VARCHAR2(1000);',
' V_NACIONALIDADE EMBARCACAO.NACIONALIDADE%TYPE;',
' V_TIPO_SERVICO  EMBARCACAO.TIPO_SERVICO%TYPE;',
'--',
'BEGIN',
'  -- Definir nacionalidade',
'   SELECT NACIONALIDADE',
'     INTO V_NACIONALIDADE',
'     FROM EMBARCACAO',
'    WHERE COD_EMBARCACAO = :P7_COD;',
'  --',
unistr('  -- Definir Servi\00E7o'),
'   SELECT TIPO_SERVICO',
'     INTO V_TIPO_SERVICO',
'     FROM EMBARCACAO',
'    WHERE COD_EMBARCACAO = :P7_COD;',
'  --',
'    IF V_NACIONALIDADE = ''N'' THEN',
'',
'        V_URL := APEX_PAGE.GET_URL (P_APPLICATION => :APP_ID,',
'                                   P_PAGE        => 15,',
'                                   P_ITEMS       => ''P15_ID,P15_VISUALIZAR,P15_OPERACAO'',',
'                                   P_VALUES      => :P7_COD || '','' || :P7_VISUALIZAR || '','' || :P7_OPERACAO );',
'',
'    ELSIF V_NACIONALIDADE = ''E'' THEN',
'',
'        V_URL := APEX_PAGE.GET_URL (P_APPLICATION => :APP_ID,',
'                                   P_PAGE        => 26,',
'                                   P_ITEMS       => ''P26_ID,P26_VISUALIZAR,P26_OPERACAO'',',
'                                   P_VALUES      => :P7_COD || '','' || :P7_VISUALIZAR || '','' || :P7_OPERACAO );',
'',
'',
'    ELSE',
'',
'        -- Em reforma',
'        IF V_TIPO_SERVICO = ''R'' THEN ',
'            V_URL := APEX_PAGE.GET_URL (P_APPLICATION => :APP_ID,',
'                                        P_PAGE        => 16,',
'                                        P_ITEMS       => ''P16_ID,P16_VISUALIZAR,P16_OPERACAO'',',
'                                        P_VALUES      => :P7_COD || '','' || :P7_VISUALIZAR || '','' || :P7_OPERACAO );',
'',
unistr('        -- Em constru\00E7\00E3o'),
'        ELSE',
'            V_URL := APEX_PAGE.GET_URL (P_APPLICATION => :APP_ID,',
'                                        P_PAGE        => 27,',
'                                        P_ITEMS       => ''P27_ID,P27_VISUALIZAR,P27_OPERACAO'',',
'                                        P_VALUES      => :P7_COD || '','' || :P7_VISUALIZAR || '','' || :P7_OPERACAO );',
'        END IF;',
'        ',
'    END IF;',
'  --',
'   APEX_UTIL.REDIRECT_URL (V_URL); ',
'  --',
'END;'))
,p_process_clob_language=>'PLSQL'
