,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'PRC_CREATE_EMBARCACAO'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
' V_EMBARCACAO      EMBARCACAO%ROWTYPE;',
' V_DOC_PROPRIEDADE NUMBER;',
' V_DOC_SEGURANCA   NUMBER;',
'--',
' CURSOR CUR_DOCUMENTO IS',
' SELECT C001    IND_TIPO_DOCUMENTO',
'    ,   C002    TIPO',
'    ,   C003    NOME_ARQUIVO',
'    ,   C004    MIME_TYPE',
'    ,   D001    DATA_VALIDADE',
'    ,   BLOB001 ARQUIVO',
'   FROM APEX_COLLECTIONS',
'  WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO'';',
'--',
'BEGIN',
'  --',
'   SELECT COUNT(1)',
'     INTO V_DOC_PROPRIEDADE',
'     FROM APEX_COLLECTIONS',
'    WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO''',
'      AND C001            = ''P'';',
'  --',
'   SELECT COUNT(1)',
'     INTO V_DOC_SEGURANCA',
'     FROM APEX_COLLECTIONS',
'    WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO''',
'      AND C001            = ''S'';',
'  --',
'   IF V_DOC_PROPRIEDADE = 0',
'    THEN',
'      --',
unistr('       RAISE_APPLICATION_ERROR (-20000, ''Documenta\00E7\00E3o de propriedade ausente!'');'),
'      --',
'   END IF;',
'  --',
'   IF V_DOC_SEGURANCA = 0',
'    THEN',
'      --',
unistr('       RAISE_APPLICATION_ERROR (-20000, ''Documenta\00E7\00E3o de seguran\00E7a ausente!'');'),
'      --',
'   END IF;',
'  --',
'   V_EMBARCACAO.COD_EMBARCACAO               := EMBARCACAO_SEQ.NEXTVAL;',
'   V_EMBARCACAO.SITUACAO_CADASTRAL           := ''A'';',
'  --',
'   V_EMBARCACAO.NACIONALIDADE                := :P15_NACIONALIDADE;',
'   V_EMBARCACAO.IND_ARQUEACAO_BRUTA          := :P15_IND_ARQUEACAO_BRUTA;',
'  -- ',
'   V_EMBARCACAO.NUM_INSCRICAO                := :P15_NUMERO_INSCRICAO;',
'   V_EMBARCACAO.NUM_IMO                      := :P15_NUMERO_IMO;',
'   V_EMBARCACAO.NOME                         := :P15_NOME;',
'   V_EMBARCACAO.BANDEIRA_ORIGEM              := :P15_BANDEIRA_ORIGEM;',
'   V_EMBARCACAO.BANDEIRA_ATUAL               := :P15_BANDEIRA_ATUAL;',
'   V_EMBARCACAO.IND_NUM_IRIN                 := :P15_IND_NUMERO_IRIN;',
'   V_EMBARCACAO.NUM_IRIN                     := TO_CHAR(:P15_NUMERO_IRIN);',
'   V_EMBARCACAO.NUM_PRPM                     := :P15_NUMERO_PRPM;',
'   V_EMBARCACAO.NUM_TIE                      := :P15_NUMERO_TIE;',
'   V_EMBARCACAO.NUM_DPP                      := :P15_NUMERO_DPP;',
'   V_EMBARCACAO.NUM_PROTOCOLO_INSCRICAO      := :P15_NUMERO_PROCOLOCO_INSCRICAO;',
'   V_EMBARCACAO.NUM_INSCRICAO_PROVISORIA     := :P15_NUMERO_INSCRICAO_PROVISORIA;',
'   V_EMBARCACAO.NUM_REB                      := :P15_NUMERO_REB;',
'  -- ',
'   V_EMBARCACAO.TIPO_NAVEGACAO               := :P15_TIPO_NAVEGACAO;',
'   V_EMBARCACAO.AREA_NAVEGACAO               := :P15_AREA_NAVEGACAO;',
'   V_EMBARCACAO.NATUREZA_TIPO_CARGA          := :P15_NATUREZA_TIPO_CARGA;',
'   V_EMBARCACAO.TIPO_EMBARCACAO              := :P15_TIPO;',
'   V_EMBARCACAO.CLASSE_EMBARCACAO            := :P15_CLASSE;',
'   V_EMBARCACAO.SITUACAO                     := :P15_SITUACAO;',
'   V_EMBARCACAO.ANO_EMBARCACAO               := :P15_ANO_CONSTRUCAO;',
'   V_EMBARCACAO.MATERIAL_CASCO               := :P15_MATERIAL_CASCO;',
'   V_EMBARCACAO.TIPO_PROPULSAO               := :P15_PROPULSAO_UTILIZADA;',
'   V_EMBARCACAO.NUM_BHP                      := :P15_BHP;',
'   V_EMBARCACAO.QTD_MOTOR                    := :P15_QTD_MOTORES_UTILIZADOS;',
'   V_EMBARCACAO.VALOR_ARQUEACAO_BRUTA        := :P15_ARQUEACAO_BRUTA;',
'   V_EMBARCACAO.VALOR_ARQUEACAO_LIQUIDA      := :P15_ARQUEACAO_LIQUIDA;',
'   V_EMBARCACAO.VALOR_TPB                    := :P15_TPB;',
'   V_EMBARCACAO.COMPRIMENTO_EMBARCACAO       := :P15_COMPRIMENTO_EMBARCACAO;',
'   V_EMBARCACAO.COMPRIMENTO_BOCA             := :P15_BOCA;',
'   V_EMBARCACAO.COMPRIMENTO_CALADO           := :P15_CALADO;',
'   V_EMBARCACAO.VALOR_VELOCIDADE             := :P15_VELOCIDADE;',
'   V_EMBARCACAO.VALOR_CAPACIDADE             := :P15_CAPACIDADE_CARGA;',
'   V_EMBARCACAO.IND_CAPACIDADE_CARGA         := :P15_CAPACIDADE_CARGA_UN;',
'   V_EMBARCACAO.VALOR_CAPACIDADE_VEICULO     := :P15_CAPACIDADE_VEICULO;',
'   V_EMBARCACAO.VALOR_CAPACIDADE_TEUS        := :P15_CAPACIDADE_TEUS;',
'   V_EMBARCACAO.VALOR_CAPACIDADE_PASSAGEIROS := :P15_CAPACIDADE_PASSAGEIROS;',
'  --',
'   INSERT INTO EMBARCACAO',
'        VALUES V_EMBARCACAO;',
'  --',
'   FOR X IN CUR_DOCUMENTO LOOP',
'    --',
'     INSERT INTO EMBARCACAO_DOCUMENTO (COD_EMBARCACAO_DOCUMENTO',
'                                      ,COD_EMBARCACAO',
'                                      ,IND_TIPO_DOCUMENTO',
'                                      ,TIPO',
'                                      ,NOME_ARQUIVO',
'                                      ,MIME_TYPE',
'                                      ,ARQUIVO',
'                                      ,DATA_VALIDADE)',
'          VALUES (EMBARCACAO_DOCUMENTO_SEQ.NEXTVAL',
'                 ,V_EMBARCACAO.COD_EMBARCACAO',
'                 ,X.IND_TIPO_DOCUMENTO',
'                 ,X.TIPO',
'                 ,X.NOME_ARQUIVO',
'                 ,X.MIME_TYPE',
'                 ,X.ARQUIVO',
'                 ,X.DATA_VALIDADE); ',
'    --',
'   END LOOP;',
'  --',
'   COMMIT;',
'  --',
'   IF APEX_COLLECTION.COLLECTION_EXISTS(''COL_DOCUMENTO_EMBARCACAO'')',
'    THEN',
'      --',
'       APEX_COLLECTION.DELETE_COLLECTION(''COL_DOCUMENTO_EMBARCACAO'');',
'      --',
'   END IF;',
'  --',
'',
'END;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_when_button_id=>wwv_flow_imp.id(68070393298190450)
