,p_process_name=>'PRC_CREATE_EMBARCACAO'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
' V_EMBARCACAO        EMBARCACAO%ROWTYPE;',
' V_DOC_COMPROBATORIA NUMBER;',
' ',
'--',
' CURSOR CUR_DOCUMENTO IS',
' SELECT C001    IND_TIPO_DOCUMENTO',
'    ,   C002    TIPO',
'    ,   C003    NOME_ARQUIVO',
'    ,   C004    MIME_TYPE',
'    ,   D001    DATA_VALIDADE',
'    ,   BLOB001 ARQUIVO',
'   FROM APEX_COLLECTIONS',
'  WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO'';',
'--',
'BEGIN',
'  --',
'   SELECT COUNT(1)',
'     INTO V_DOC_COMPROBATORIA',
'     FROM APEX_COLLECTIONS',
'    WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO'';',
'      --AND C001            = ''C'';',
'  --',
'   IF V_DOC_COMPROBATORIA = 0',
'    THEN',
'      --',
unistr('       RAISE_APPLICATION_ERROR (-20000, ''Documenta\00E7\00E3o comprobat\00F3ria ausente!'');'),
'      --',
'   END IF;',
'  --',
'   V_EMBARCACAO.COD_EMBARCACAO               := EMBARCACAO_SEQ.NEXTVAL;',
'  --',
'   V_EMBARCACAO.NACIONALIDADE                := :P16_NACIONALIDADE;',
'   V_EMBARCACAO.IND_ARQUEACAO_BRUTA          := :P16_IND_ARQUEACAO_BRUTA;',
'  -- ',
'   V_EMBARCACAO.NUM_INSCRICAO                := '''';',
'   V_EMBARCACAO.NUM_IMO                      := :P16_NUMERO_IMO;',
'   V_EMBARCACAO.NOME                         := :P16_NOME;',
'   V_EMBARCACAO.BANDEIRA_ORIGEM              := '''';',
'   V_EMBARCACAO.BANDEIRA_ATUAL               := :P16_BANDEIRA_ATUAL;',
'   V_EMBARCACAO.IND_NUM_IRIN                 := ''Y'';',
'   V_EMBARCACAO.NUM_IRIN                     := :P16_NUMERO_IRIN;',
'  -- ',
'   V_EMBARCACAO.NUM_PRPM                     := '''';',
'   V_EMBARCACAO.NUM_TIE                      := '''';',
'   V_EMBARCACAO.NUM_DPP                      := '''';',
'   V_EMBARCACAO.NUM_PROTOCOLO_INSCRICAO      := '''';',
'   V_EMBARCACAO.NUM_INSCRICAO_PROVISORIA     := '''';',
'   V_EMBARCACAO.NUM_REB                      := '''';',
'  -- ',
'   V_EMBARCACAO.TIPO_NAVEGACAO               := :P16_TIPO_NAVEGACAO;',
'   V_EMBARCACAO.AREA_NAVEGACAO               := :P16_AREA_NAVEGACAO;',
'   V_EMBARCACAO.NATUREZA_TIPO_CARGA          := :P16_NATUREZA_TIPO_CARGA;',
'  -- ',
'   V_EMBARCACAO.TIPO_EMBARCACAO              := :P16_TIPO;',
'   V_EMBARCACAO.CLASSE_EMBARCACAO            := :P16_CLASSE;',
'   V_EMBARCACAO.SITUACAO                     := :P16_SITUACAO;',
'   V_EMBARCACAO.ANO_EMBARCACAO               := :P16_ANO_CONSTRUCAO;',
'   V_EMBARCACAO.MATERIAL_CASCO               := '''';',
'   V_EMBARCACAO.TIPO_PROPULSAO               := '''';',
'   V_EMBARCACAO.NUM_BHP                      := :P16_BHP;',
'   V_EMBARCACAO.QTD_MOTOR                    := '''';',
'   V_EMBARCACAO.VALOR_ARQUEACAO_BRUTA        := :P16_ARQUEACAO_BRUTA;',
'   V_EMBARCACAO.VALOR_ARQUEACAO_LIQUIDA      := :P16_ARQUEACAO_LIQUIDA;',
'   V_EMBARCACAO.VALOR_TPB                    := :P16_TPB;',
'   V_EMBARCACAO.COMPRIMENTO_EMBARCACAO       := :P16_COMPRIMENTO_EMBARCACAO;',
'   V_EMBARCACAO.COMPRIMENTO_BOCA             := :P16_BOCA;',
'   V_EMBARCACAO.COMPRIMENTO_CALADO           := :P16_CALADO;',
'   V_EMBARCACAO.VALOR_VELOCIDADE             := :P16_VELOCIDADE;',
'   V_EMBARCACAO.VALOR_CAPACIDADE             := '''';',
'   V_EMBARCACAO.IND_CAPACIDADE_CARGA         := '''';',
'   V_EMBARCACAO.VALOR_CAPACIDADE_VEICULO     := '''';',
'   V_EMBARCACAO.VALOR_CAPACIDADE_TEUS        := :P16_CAPACIDADE_TEUS;',
'   V_EMBARCACAO.VALOR_CAPACIDADE_PASSAGEIROS := '''';',
'  --',
'   INSERT INTO EMBARCACAO',
'        VALUES V_EMBARCACAO;',
'  --',
'   FOR X IN CUR_DOCUMENTO LOOP',
'    --',
'     INSERT INTO EMBARCACAO_DOCUMENTO (COD_EMBARCACAO_DOCUMENTO',
'                                      ,COD_EMBARCACAO',
'                                      ,IND_TIPO_DOCUMENTO',
'                                      ,TIPO',
'                                      ,NOME_ARQUIVO',
'                                      ,MIME_TYPE',
'                                      ,ARQUIVO',
'                                      ,DATA_VALIDADE)',
'          VALUES (EMBARCACAO_DOCUMENTO_SEQ.NEXTVAL',
'                 ,V_EMBARCACAO.COD_EMBARCACAO',
