,p_action_sequence=>10
,p_execute_on_page_init=>'N'
,p_action=>'NATIVE_JAVASCRIPT_CODE'
,p_attribute_01=>wwv_flow_string.join(wwv_flow_t_varchar2(
unistr('// Fun\00E7\00E3o para aplicar m\00E1scaras de CPF ou CNPJ'),
'function aplicarMascaraCPFouCNPJ(valor) {',
unistr('    // Remove tudo que n\00E3o \00E9 d\00EDgito'),
'    valor = valor.replace(/\D/g, '''');',
'',
'    if (valor.length <= 11) {',
unistr('        // Aplica m\00E1scara de CPF: 999.999.999-99'),
'        valor = valor.replace(/(\d{3})(\d)/, "$1.$2");',
'        valor = valor.replace(/(\d{3})(\d)/, "$1.$2");',
'        valor = valor.replace(/(\d{3})(\d{1,2})$/, "$1-$2");',
'    } else {',
unistr('        // Aplica m\00E1scara de CNPJ: 99.999.999/9999-99'),
'        valor = valor.replace(/^(\d{2})(\d)/, "$1.$2");',
'        valor = valor.replace(/^(\d{2})\.(\d{3})(\d)/, "$1.$2.$3");',
'        valor = valor.replace(/\.(\d{3})(\d)/, ".$1/$2");',
'        valor = valor.replace(/(\d{4})(\d{1,2})$/, "$1-$2");',
'    }',
'',
'    return valor;',
'}',
'',
'// Pega o valor atual do campo',
'var valorCampo = $v(''P26_PROPRIEDADE'');',
'',
unistr('// Aplica a m\00E1scara de acordo com o valor digitado'),
'var valorFormatado = aplicarMascaraCPFouCNPJ(valorCampo);',
'',
unistr('// Atualiza o valor do item de p\00E1gina com o valor formatado'),
'$s(''P26_PROPRIEDADE'', valorFormatado);',
''))
);
