,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'DECLARE',
' V_EMBARCACAO      EMBARCACAO%ROWTYPE;',
' V_DOC_PROPRIEDADE NUMBER;',
' V_DOC_SEGURANCA   NUMBER;',
'--',
' CURSOR CUR_DOCUMENTO IS',
' SELECT C001    IND_TIPO_DOCUMENTO',
'    ,   C002    TIPO',
'    ,   C003    NOME_ARQUIVO',
'    ,   C004    MIME_TYPE',
'    ,   D001    DATA_VALIDADE',
'    ,   BLOB001 ARQUIVO',
'   FROM APEX_COLLECTIONS',
'  WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO'';',
'--',
'BEGIN',
'  --',
'   SELECT COUNT(1)',
'     INTO V_DOC_PROPRIEDADE',
'     FROM APEX_COLLECTIONS',
'    WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO''',
'      AND C001            = ''P'';',
'  --',
'   SELECT COUNT(1)',
'     INTO V_DOC_SEGURANCA',
'     FROM APEX_COLLECTIONS',
'    WHERE COLLECTION_NAME = ''COL_DOCUMENTO_EMBARCACAO''',
'      AND C001            = ''S'';',
'  --',
'   IF V_DOC_PROPRIEDADE = 0',
'    THEN',
'      --',
unistr('       RAISE_APPLICATION_ERROR (-20000, ''Documenta\00E7\00E3o de propriedade ausente!'');'),
'      --',
'   END IF;',
'  --',
'   IF V_DOC_SEGURANCA = 0',
'    THEN',
'      --',
unistr('       RAISE_APPLICATION_ERROR (-20000, ''Documenta\00E7\00E3o de seguran\00E7a ausente!'');'),
'      --',
'   END IF;',
'  --',
'   V_EMBARCACAO.COD_EMBARCACAO               := EMBARCACAO_SEQ.NEXTVAL;',
'   V_EMBARCACAO.SITUACAO_CADASTRAL           := ''A'';',
'  --',
'   V_EMBARCACAO.NACIONALIDADE                := :P26_NACIONALIDADE;',
'   V_EMBARCACAO.IND_ARQUEACAO_BRUTA          := :P26_IND_ARQUEACAO_BRUTA;',
'  -- ',
'   V_EMBARCACAO.NUM_INSCRICAO                := :P26_NUMERO_INSCRICAO;',
'   V_EMBARCACAO.NUM_IMO                      := :P26_NUMERO_IMO;',
