'   V_EMBARCACAO.CLASSE_EMBARCACAO            := :P802_CLASSE;',
'   V_EMBARCACAO.SITUACAO                     := :P802_SITUACAO;',
'   V_EMBARCACAO.ANO_EMBARCACAO               := :P802_ANO_CONSTRUCAO;',
'   V_EMBARCACAO.MATERIAL_CASCO               := :P802_MATERIAL_CASCO;',
'   V_EMBARCACAO.TIPO_PROPULSAO               := :P802_PROPULSAO_UTILIZADA;',
'   V_EMBARCACAO.NUM_BHP                      := :P802_BHP;',
'   V_EMBARCACAO.QTD_MOTOR                    := :P802_QTD_MOTORES_UTILIZADOS;',
'   V_EMBARCACAO.VALOR_ARQUEACAO_BRUTA        := :P802_ARQUEACAO_BRUTA;',
'   V_EMBARCACAO.VALOR_ARQUEACAO_LIQUIDA      := :P802_ARQUEACAO_LIQUIDA;',
'   V_EMBARCACAO.VALOR_TPB                    := :P802_TPB;',
'   V_EMBARCACAO.COMPRIMENTO_EMBARCACAO       := :P802_COMPRIMENTO_EMBARCACAO;',
'   V_EMBARCACAO.COMPRIMENTO_BOCA             := :P802_BOCA;',
'   V_EMBARCACAO.COMPRIMENTO_CALADO           := :P802_CALADO;',
'   V_EMBARCACAO.VALOR_VELOCIDADE             := :P802_VELOCIDADE;',
'   V_EMBARCACAO.VALOR_CAPACIDADE             := :P802_CAPACIDADE_CARGA;',
'   V_EMBARCACAO.IND_CAPACIDADE_CARGA         := :P802_CAPACIDADE_CARGA_UN;',
'   V_EMBARCACAO.VALOR_CAPACIDADE_VEICULO     := :P802_CAPACIDADE_VEICULO;',
'   V_EMBARCACAO.VALOR_CAPACIDADE_TEUS        := :P802_CAPACIDADE_TEUS;',
'   V_EMBARCACAO.VALOR_CAPACIDADE_PASSAGEIROS := :P802_CAPACIDADE_PASSAGEIROS;',
