'                                      ,MIME_TYPE',
'                                      ,ARQUIVO',
'                                      ,DATA_VALIDADE)',
'          VALUES (EMBARCACAO_DOCUMENTO_SEQ.NEXTVAL',
'                 ,V_EMBARCACAO.COD_EMBARCACAO',
'                 ,X.IND_TIPO_DOCUMENTO',
'                 ,X.TIPO',
'                 ,X.NOME_ARQUIVO',
'                 ,X.MIME_TYPE',
'                 ,X.ARQUIVO',
'                 ,X.DATA_VALIDADE); ',
'    --',
'   END LOOP;',
'  --',
'   COMMIT;',
'  --',
'   IF APEX_COLLECTION.COLLECTION_EXISTS(''COL_DOCUMENTO_EMBARCACAO'')',
'    THEN',
'      --',
'       APEX_COLLECTION.DELETE_COLLECTION(''COL_DOCUMENTO_EMBARCACAO'');',
'      --',
'   END IF;',
'  --',
'',
'END;'))
